// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awHeaderContextRenderFn } from 'js/AwHeaderContextService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwHeaderContextService', () => import('js/AwHeaderContextService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "awHeaderContextRenderFn",
            "deps": "js/AwHeaderContextService",
            "options": {
                "elementRefList": [
                    "headerContext"
                ]
            }
        }
    },
    "data": {},
    "conditions": {},
    "onEvent": [],
    "ctx": {
        "awSidenavConfig.globalSidenavContext.globalNavigationSideNav": null,
        "showUserSettingsBar": null
    },
    "lifecycleHooks": {
        "render": "render"
    },
    "i18n": {
        "MORE_LINK_TEXT": [
            "BaseMessages"
        ]
    },
    "props": {
        "alignment": {
            "type": "string"
        },
        "anchor": {
            "type": "object"
        }
    },
    "_viewModelId": "AwHeaderContext",
    "_uniqueViewModelId": "AwHeaderContext"
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awHeaderContextRenderFn, {"elementRefList":["headerContext"]}, ctxImportObj );

export default Component;
